import React from 'react'
import Chart from 'react-google-charts'

class App2 extends React.Component {

pieParser(data){
    var pie = new Array(data.lenght+1);
    var bluesum=0,  brownsum=0, blacksum=0, greensum=0, redsum=0, yellowsum = 0;
    var i;
    pie[data.length-1] = new Array(2);
    for(i=0; i<data.length; i++){
        pie[i] = new Array(2);
        console.log("testing "+data[i].name)

        if(data[i].favColor === "blue"){
            bluesum++;
        }
        if(data[i].favColor === "brown"){
           brownsum++;
       }
       if(data[i].favColor === "black"){
           blacksum++;
       }
       if(data[i].favColor === "green"){
           greensum++;
       }
       if(data[i].favColor === "red"){
           redsum++;
       }
       if(data[i].favColor === "yellow"){
           yellowsum++;
       }
    }
    console.log("blue"+bluesum+"red"+redsum+"brown"+brownsum+"black"+blacksum+"green"+greensum+"yellow"+yellowsum)
     pie[0][0] = "Color"
     pie[0][1] = "Number of people which has this color as favorite";
     
     pie[1][0] = "brown"
     pie[1][1] = brownsum;

     pie[2][0] = "black"
     pie[2][1] = blacksum;

     pie[3][0] = "green"
     pie[3][1] = greensum;

     pie[4][0] = "red"
     pie[4][1] = redsum;

     pie[5][0] = "yellow"
     pie[5][1] = yellowsum;

     pie[6][0] = "blue";
     pie[6][1] = bluesum;

     return pie;


}

scatterParser(data){
    var scat= new Array(7);
    scat[0] = ["Hours Studied","Grade Point Average"];
    for(var i=1; i<7; i ++){
        scat[i] = new Array(2);
        scat[i][0]= data[i-1].hoursStudied;
        scat[i][1] = data[i-1].gradePointAverage;
    }
    console.log(scat.toString());
    return scat;
}



render(){
    //var histo = new Array(6);
    var data = [
        {
            "id": 42,
            "age": 28,
            "eyeColor": "blue",
            "name": "Roth Solis",
            "gender": "male",
            "gradePointAverage": 6,
            "hoursStudied": 8,
            "favColor": "brown"
          },
          {
            "id": 53,
            "age": 36,
            "eyeColor": "blue",
            "name": "Brennan Burke",
            "gender": "male",
            "gradePointAverage": 19,
            "hoursStudied": 0,
            "favColor": "green"
          },
          {
            "id": 2,
            "age": 40,
            "eyeColor": "blue",
            "name": "Lilian Clark",
            "gender": "female",
            "gradePointAverage": 7,
            "hoursStudied": 23,
            "favColor": "yellow"
          },
          {
            "id": 100,
            "age": 23,
            "eyeColor": "blue",
            "name": "Morrow Dixon",
            "gender": "male",
            "gradePointAverage": 12,
            "hoursStudied": 6,
            "favColor": "brown"
          },
          {
            "id": 79,
            "age": 34,
            "eyeColor": "green",
            "name": "Ina Horn",
            "gender": "female",
            "gradePointAverage": 9,
            "hoursStudied": 14,
            "favColor": "red"
          },
          {
            "id": 99,
            "age": 24,
            "eyeColor": "green",
            "name": "Genevieve Lynch",
            "gender": "female",
            "gradePointAverage": 15,
            "hoursStudied": 5,
            "favColor": "black"
          }
      ];
     var pie = this.pieParser(data);
    var scat = this.scatterParser(data);
    return (

        <div>
        <h1>Hello user !</h1>

        <Chart  width={300}
        height={300}
        chartType="ColumnChart"
        loader={<div>Loading Chart</div>}
        data={[
          ['City', '2010 Population'],
          ['New York City, NY', 8175000],
          ['Los Angeles, CA', 3792000],
          ['Chicago, IL', 2695000],
          ['Houston, TX', 2099000],
          ['Philadelphia, PA', 1526000],
        ]}
        options={{
          title: 'Population of Largest U.S. Cities',
          chartArea: { width: '30%' },
          hAxis: {
            title: 'Total Population',
            minValue: 0,
          },
          vAxis: {
            title: 'City',
          },
        }}
        legendToggle/>

<Chart
  width={'500px'}
  height={'300px'}
  chartType="PieChart"
  loader={<div>Loading Chart</div>}
  data=/*{[
    ['Task', 'Hours per Day'],
    ['Work', 11],
    ['Eat', 2],
    ['Commute', 2],
    ['Watch TV', 2],
    ['Sleep', 7],
  ]}*/{pie}
  options={{
    title: 'My Daily Activities',
  }}
  rootProps={{ 'data-testid': '1' }}
/>
<Chart
  width={'500px'}
  height={'300px'}
  chartType="ScatterChart"
  loader={<div>Loading Chart</div>}
  data=/*{[
    ['Diameter', 'Age'],
    [8, 37],
    [4, 19.5],
    [11, 52],
    [4, 22],
    [3, 16.5],
    [6.5, 32.8],
    [14, 72],
  ]}*/ {scat}
  options={{
    title: 'Age of sugar maples vs. trunk diameter, in inches',
    hAxis: { title: 'Diameter' },
    vAxis: { title: 'Age' },
    legend: 'none',
    trendlines: { 0: {} },
  }}
  rootProps={{ 'data-testid': '1' }}
/>
        </div>

    );

}
    

    

}

export default App2;
